#12838 was just for files then used by types-publisher; now I did it for all files. Working on changes to types-publisher to prevent these from coming up again.

Done using a script:

```ts
/// <reference types="node" />

import fs = require("fs");
import stripBom = require('strip-bom');
import path = require("path");

function recur(dir: string) {
    const files = fs.readdirSync(dir);
    for (const file of files) {
        if (file === ".git" || file === "node_modules") {
            continue;
        }

        const full = path.join(dir, file);
        const stat = fs.statSync(full);
        if (stat.isDirectory()) {
            recur(full);
        } else {
            const text = fs.readFileSync(full, "utf-8");
            const hasBom = text.charCodeAt(0) === 0xFEFF;
            if (hasBom) {
                console.log("BOM:", full);
                const withoutBom = text.slice(1);
                fs.writeFileSync(full, withoutBom);
            }
        }
    }
}

recur("..");
```

